window.bookSummaryJSON = "<p>The Outfit was organized crime with a capital O. They were big. They were bad. They were brutal. And no crook ever crossed them and lived to enjoy it. Except Parker. So they wanted Parker dead, and a hit man proved they meant business. Too bad for the Outfit he missed. Ripping off the Outfit was the easy part of Parker's game. Going one-on-one with Bronson, the Outfit's Big Boss, was the hard part.</p>"; 
